import React from 'react';
import './Rewards.css';

const rewards = [
  { user: 'John Doe', points: 450, redeemed: 200 },
  { user: 'Alice Smith', points: 120, redeemed: 0 },
];

export default function Rewards() {
  return (
    <div className="page rewards-page">
      <h2>Rewards</h2>
      <table className="table">
        <thead><tr><th>User</th><th>Points</th><th>Redeemed</th></tr></thead>
        <tbody>
          {rewards.map((r,i) => (
            <tr key={i}><td>{r.user}</td><td>{r.points}</td><td>{r.redeemed}</td></tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
